import React from "react";
import Header from "../header-footer/header";
import Footer from "../header-footer/footer";

export default function Home(){
    return(
        <>
        <Header />
        <div class="container">
        <div class="text">
            <h1>Banking Made Easy</h1>
            <p>Experience hassle-free transactions and enjoy our exclusive offers.</p>
        </div>
        <div class="image-container">
            <img src="https://img.freepik.com/free-vector/flat-woman-paying-by-pos-terminal-refund-cashback_88138-785.jpg?t=st=1726832923~exp=1726836523~hmac=33af9f974fd407c7901aaacb09572e157cc9e3e71aa6234c9c2ee3c6bb232d65&w=900" alt="Banking Image" />
        </div>
    </div>
        <Footer />
        </>
    );
}
